import { useState } from 'react';
import { ResponsiveBar } from '@nivo/bar';
import {PieChart, Pie,BarChart, XAxis, YAxis, Tooltip, Legend, Bar,CartesianGrid} from 'recharts';


export default function Dashboard() {
    const exp_data = [
        {
            "skill": "ETL/ELT",
            "exp": 4
        },
        {
            "skill": "Python",
            "exp": 3
        },
        {
            "skill": "SQL",
            "exp": 4,

        },
        {
            "skill": "Generative-AI",
            "exp": 1
        },
        {
            "skill": "Machine Learning",
            "exp": 2
        }
    ]
    const data = [
        {
            "name": "Snowflake",
            "exp": 4.2
        },

        {
            "name": "Python",
            "exp": 5
        },
        {
            "name": "SQL",
            "exp": 5
        },
        {
            "name": "Linux",
            "exp": 1
        }
    ]


    return (
        <div
            className="dash-container"
            style={{
                display:"flex"
            }}
        >
            <BarChart width={450} height={630} data={data} layout='horizontal'>
            <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="exp" stackId="a" fill="#87BBA2" />
            </BarChart>
            <div 
                className="skill-exp-pie"
                >
                    <PieChart width={730} height={250}>
                        <Tooltip />
                        <Pie data={exp_data} dataKey="exp" nameKey="skill" fill='#8884d8' />
                    </PieChart>

            </div>


</div>
    );
}
